y embarrassing fashion! In between all that excitement, perhaps you'll get a chance to relax to some classic ASMR triggers including whispering, rambling, and clicking sounds. Enjoy!\n\nI strongly recommend listening to this video with headphones for the best experience :)\n\nWorld seed (from http://www.minecraftvillageseeds.com): -1805524859005456943\n\nGame: Minecraft 1.10\nDeveloper: Mojang\nAvailability: https://minecraft.net/en/store/\n\n----- Mods -----\nSonic Ether's Unbelievable Shaders v11.0\nhttp://www.minecraftforum.net/forums/mapping-and-modding/minecraft-mods/1280299-sonic-ethers-unbelievable-shaders-v11-0\n\nOptiFine 1.10 HD U B7\nhttps://optifine.net/downloads\n\nChroma Hills Resource Pack\nhttp://www.chromahills.com/forum/downloads.php\n\n----- PC specs for nerds -----\nCPU: Intel Core i7-4770K @ 4.4GHz\nCPU Cooler: Noctua NH-D14\nGPU: Asus GeForce GTX 980 STRIX 4GB @ 1.5GHz\nRAM: G.Skill Trident X 16GB DDR3 @ 2400MHz CL10-12-12-31\nMotherboard: ASRock Z87 Extreme4\nSSD: A-Data XPG SX900 256GB\nHDD: Toshiba DT01ACA300 7200RPM 3TB\nPSU: EVGA Supernova 750 G2\nCase: Fractal Design Define R5\n\n----- What's ASMR, and why am I whispering? -----\nI whisper in my videos because they're intended to trigger a sensation called ASMR (Autonomous Sensory Meridian Response). ASMR is a specific feeling that some people experience when they hear certain soft sounds, like whispering and tapping, or see certain visuals, like deliberate hand motions. It's often described as a pleasant tingling in the head and neck, accompanied by a sense of calmness and mild euphoria. Many people watch ASMR videos to help them relax or fall asleep. To learn more about ASMR, I recommend checking out http://asmruniversity.com/about-asmr/what-is-asmr/. Happy tingles!\n\n----- Talk to me! -----\nFacebook: http://www.facebook.com/nick.theASMRnerd\nTwitter: http://twitter.com/theASMRnerd (@theASMRnerd)\nReddit: http://www.reddit.com/u/theASMRnerd\nEmail: theASMRnerd at gmail.com","isCrawlab inecraft fans! It's high time for another whispered adventure in Pixel Paradise, in which I meet some cute piggies, fight some ugly zombies, discover some spooky caves, and manage to kill myself in a terribly embarrassing fashion! In between all that excitement, perhaps you'll get a chance to relax to some classic ASMR triggers including whispering, rambling, and clicking sounds. Enjoy!\n\nI strongly recommend listening to this video with headphones for the best experience :)\n\nWorld seed (from http://www.minecraftvillageseeds.com): -1805524859005456943\n\nGame: Minecraft 1.10\nDeveloper: Mojang\nAvailability: https://minecraft.net/en/store/\n\n----- Mods -----\nSonic Ether's Unbelievable Shaders v11.0\nhttp://www.minecraftforum.net/forums/mapping-and-modding/minecraft-mods/1280299-sonic-ethers-unbelievable-shaders-v11-0\n\nOptiFine 1.10 HD U B7\nhttps://optifine.net/downloads\n\nChroma Hills Resource Pack\nhttp://www.chromahills.com/forum/downloads.php\n\n----- PC specs for nerds -----\nCPU: Intel Core i7-4770K @ 4.4GHz\nCPU Cooler: Noctua NH-D14\nGPU: Asus GeForce GTX 980 STRIX 4GB @ 1.5GHz\nRAM: G.Skill Trident X 16GB DDR3 @ 2400MHz CL10-12-12-31\nMotherboard: ASRock Z87 Extreme4\nSSD: A-Data XPG SX900 256GB\nHDD: Toshiba DT01ACA300 7200RPM 3TB\nPSU: EVGA Supernova 750 G2\nCase: Fractal Design Define R5\n\n----- What's ASMR, and why am I whispering? -----\nI whisper in my videos because they're intended to trigger a sensation called ASMR (Autonomous Sensory Meridian Response). ASMR is a specific feeling that some people experience when they hear certain soft sounds, like whispering and tapping, or see certain visuals, like deliberate hand motions. It's often described as a pleasant tingling in the head and neck, accompanied by a sense of calmness and mild euphoria. Many people watch ASMR videos to help them relax or fall asleep. To learn more about ASMR, I recommend checking out http://asmruniversity.com/about-asmr/what-is-asmr/. Happy tingles!\n\n----- Talk to ils":[{"url":"https://yt3.ggpht.com/_x5sr-aAKkxi0vYzAf-5ZeREbLvsYuGzfuDqO7kStJMWU6Jubyyza4LT_mKsWPI3V_q6whViwA=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"ASMR Minecraft | Pixel Paradise Playlist: ASMR|Minecraft:PixelParadise\n\nHello Minecraft fans! It's high time for another whispered adventure in Pixel Paradise, in which I meet some cute piggies, fight some ugly zombies, discover some spooky caves, and manage to kill myself in a terribly embarrassing fashion! In between all that excitement, perhaps you'll get a chance to relax to some classic ASMR triggers including whispering, rambling, and clicking sounds. Enjoy!\n\nI strongly recommend listening to this video with headphones for the best experience :)\n\nWorld seed (from http://www.minecraftvillageseeds.com): -1805524859005456943\n\nGame: Minecraft 1.10\nDeveloper: Mojang\nAvailability: https://minecraft.net/en/store/\n\n---- Mods ----\nSonic Ether's Unbelievable Shaders v11.0\nhttp://www.minecraftforum.net/forums/...\n\nOptiFine 1.10 HD U B7\nhttps://optifine.net/downloads\n\nChroma Hills Resource Pack\nhttp://www.chromahills.com/forum/down...\n\n---- PC specs for nerds ----\nCPU: Intel Core i7-4770K @ 4.4GHz\nCPU Cooler: Noctua NH-D14\nGPU: Asus GeForce GTX 980 STRIX 4GB @ 1.5GHz\nRAM: G.Skill Trident X 16GB DDR3 @ 2400MHz CL10-12-12-31\nMotherboard: ASRock Z87 Extreme4\nSSD: A-Data XPG SX900 256GB\nHDD: Toshiba DT01ACA300 7200RPM 3TB\nPSU: EVGA Supernova 750 G2\nCase: Fractal Design Define R5\n\n---- What's ASMR, and why am I whispering? ----\nI whisper in my videos because they're intended to trigger a sensation called ASMR (Autonomous Sensory Meridian Response). ASMR is a specific feeling that some people experience when they hear certain soft sounds, like whispering and tapping, or see certain visuals, like deliberate hand motions. It's often described as a pleasant tingling in the head and neck, accompanied by a sense of calmness and mild euphoria. Many people watch ASMR videos to help them relax or fall asleep. To learn more about ASMR, I recommend checking out http://asmruniversity.com/about-asmr/.... Happy tingles!\n\n---- Talk to me! ----\nFacebook: /nick.theasmrnerd\nTwitter: /theasmrnerd (@theASMRnerd)\nReddit: /theasmrnerd\nEmail: theASMRnerd at gmail.com","commandRuns":[{"startIndex":42,"length":39,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB4Q040EGAMiEwjdkJ25te2HAxWTCx4AHVFfF7c=","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLCzXSlXTeioCuIFJRDzLS0JU5hKLaae0t","webPageType":"WEB_PAGE_TYPE_PLAYLIST","rootVe":5754,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"VLPLCzXSlXTeioCuIFJRDzLS0JU5hKLaae0t","canonicalBaseUrl":"/playlist?list=PLCzXSlXTeioCuIFJRDzLS0JU5hKLaae0t"}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: ASMR | Minecraft: Pixel Paradise"}}},{"startIndex":587,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB4Q040EGAMiEwjdkJ25te2HAxWTCx4AHVFfF7dIzab5jsqtkqge","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbGhxQ0FpeTRaanlLRHZXVUJXSTNXQXVUYjMwd3xBQ3Jtc0trdHJfYkF3SFp4Q2I2YncteTRJYkI4ZFdGVnJxUTNVUEF0ZVp6WlBjUTFmeGNpZ0ZWV25aUEU4eGFUT2VtUzV6QWxob2FDcExqMGI2M1ZvNEZsS05icjhCdHBWUEZCOFNNMXZGcEZkTU0wd09XQ1FCcw\u0026q=http%3A%2F%2Fwww.minecraftvillageseeds.com%2F\u0026v=HlBJbKHeU00","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbGhxQ0FpeTRaanlLRHZXVUJXSTNXQXVUYjMwd3xBQ3Jtc0trdHJfYkF3SFp4Q2I2YncteTRJYkI4ZFdGVnJxUTNVUEF0ZVp6WlBjUTFmeGNpZ0ZWV25aUEU4eGFUT2VtUzV6QWxob2FDcExqMGI2M1ZvNEZsS05icjhCdHBWUEZCOFNNMXZGcEZkTU0wd09XQ1FCcw\u0026q=http%3A%2F%2Fwww.minecraftvillageseeds.com%2F\u0026v=HlBJbKHeU00","target":"TARGET_NEW_WI
